import React, { Fragment } from 'react';
import 'react-slideshow-image/dist/styles.css';
import Informations_generales from './Informations_generales';
import Msg_important from './Msg_important'
import Actualites from './Actualites'
import Reseau_sociaux from './Reseau_sociaux'
import Navigation from './Navigation';
import Redirection_informations_pratiques from './Redirection_informations_pratiques';
// import Actualites from './Actualites';


const Informations = () => {

  return (
    <Fragment> 
      <Navigation />
      <Msg_important />
      <Informations_generales />
      <Actualites />
      <Redirection_informations_pratiques />
      <Reseau_sociaux />
    </Fragment> 
  ) 
}

export default Informations;
